            className={clsx(classes.menuButton, !openLeft && classes.menuButtonHidden)}
          >
            <MenuIcon />
          </IconButton>
          <Typography component="h1" variant="h6" color="inherit" noWrap className={classes.title}>

          </Typography>
          <IconButton color="inherit">
            <Badge badgeContent={4} color="secondary">
              <InfoIcon 
                onClick={handleRightDrawerOpen}
              />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        openSecondary={true}
        classes={{
          paper: clsx(classes.drawerPaper, openLeft && classes.drawerPaperClose),
        }}
        openLeft={openLeft}
      >
        <div className={classes.toolbarIcon}>
          <IconButton onClick={handleLeftDrawerClose}>
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>{secondaryListItems}</List>
      </Drawer>
      <div>
        <Button type='visible' onClick={handleRightDrawerClose}/>
        <Drawer 
          anchor='right'
          variant="permanent"
          openSecondary={true}
          classes={{
            paper: clsx(classes.drawerPaper, openRight && classes.drawerPaperClose),
          }}
          openRight={openRight}
        >
          <div className={classes.toolbarIcon}>
            <IconButton onClick={handleRightDrawerClose}>
              <ChevronLeftIcon />
            </IconButton>
          </div>
          <Divider />
          <List>{secondaryListItems}</List>
        </Drawer>
      </div> */}
      {/* <main className={classes.content}> */}
        <div className={clsx(containerHeightPaper, classes.content)} width='auto'/>
        {/* <Container className={classes.container}> */}
          <Grid
            container 
            justify="flex-start"
          >
            {/* Chart */}
            {/* <Grid item xs={12} md={8} lg={9}>
              <Paper className={fixedHeightPaper}>
                <Chart />
              </Paper>
            </Grid> */}
            {/* AdminServices */}
            <Grid item xs={25} md={10} lg={4}>
              <Paper className={fixedHeightPaper}>
                <AdminServices />
              </Paper>
            </Grid>
            {/* Recent Deposits */}
            <Grid item xs={12} md={10} lg={4}>
              <Paper className={fixedHeightPaper}>
                <UserServices />
              </Paper>
            </Grid>
            {/* Recent Orders */}
            <Grid item xs={12} md={10} lg={4}>
              <Paper className={fixedHeightPaper1}>
                <EngAndDev />
              </Paper>
              <Paper className={fixedHeightPaper1}>
                <Miscellenous />
              </Paper>
            </Grid>
            {/* Recent Orders */}
            {/* <Grid item xs={12} md={4} lg={4}>
              <Paper className={fixedHeightPaper}>
                <Miscellenous />
              </Paper>
            </Grid> */}
          </Grid>
        {/* </Container> */}
      {/* </main> */}
      <AppBar className={classes.appBar1} style={{ background: 'white' }}>
        <Toolbar className={classes.toolbar}>
          <IconButton className={classes.rightIcon} >
            <AccountCircle fontSize='large' color='primary'/>
          </IconButton>
        </Toolbar>
      </AppBar>
      <AppBar position="absolute" className={clsx(classes.appBar, !openLeft && classes.appBarShiftLeft, !openRight && classes.appBarShiftRight, !openRight && !openLeft && classes.appBarShiftBoth)} style={{ background: 'lightgrey' }}>
        <Toolbar className={classes.toolbar}>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={handleLeftDrawerOpen}
            className={clsx(classes.menuButton, !openLeft && classes.menuButtonHidden)}
          >
            <MenuIcon />
          </IconButton>
          <Typography component="h1" variant="h6" color="inherit" noWrap className={classes.title}>

          </Typography>
          <IconButton color="inherit">
            <Badge badgeContent={4} color="secondary">
              <InfoIcon 
                onClick={handleRightDrawerOpen}
              />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        openSecondary={true}
        classes={{
          paper: clsx(classes.drawerPaper, openLeft && classes.drawerPaperClose),
        }}
        openLeft={openLeft}
      >
        <div className={classes.toolbarIcon}>
          <IconButton onClick={handleLeftDrawerClose}>
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>{secondaryListItems}</List>
      </Drawer>
      <div>
        <Button type='visible' onClick={handleRightDrawerClose}/>
        <Drawer 
          anchor='right'
          variant="permanent"
          openSecondary={true}
          classes={{
            paper: clsx(classes.drawerPaper, openRight && classes.drawerPaperClose),
          }}
          openRight={openRight}
        >
          <div className={classes.toolbarIcon}>
            <IconButton onClick={handleRightDrawerClose}>
              <ChevronLeftIcon />
            </IconButton>
          </div>
          <Divider />
          <List>{secondaryListItems}</List>
        </Drawer>
      </div>
    </div>
  );
}
